function App() {
  return (
    <div className="App">
      <Routes>
        <Navbar />
        <Route path="stars"></Route>
        <Route path="tags"></Route>
        <Route path="pagination" element={Posts}></Route>
        <Footer />
      </Routes>

    </div>
  );
}

export default App;
